import React from 'react';
import Heading from '../Heading';

export const Service = () => {
  return (
    <>
     <section className='service-sec-wrp'>
        <div className='container'>
            <div className='row'>
                <div className='col-12'>
                    <Heading title='My Service' />
                </div>
            </div>
        </div>
     </section>
    </>
  )
}
